import React,{Component} from 'react';
import {Form,Row,Col,Button,Container} from 'react-bootstrap';
class EnterQuiz extends Component{
    render(){
        return(
            <React.Fragment>
               <Container>
               <Row>
                    <Form.Group controlId="formBasicEmail" fluid>
                        <Col>
                            <Form.Label>Enter Code to Join</Form.Label>
                            <Form.Control type='text' placeholder="Enter the code " />
                        </Col>
                    </Form.Group>
                        <Col><Button>Enter</Button></Col>
                </Row>
               </Container>
            </React.Fragment>
        );
    }
}

export default EnterQuiz;
